INSERT INTO `django_flatpage` VALUES (1,'/about/about-us/','About SITCO Group','<p>Sitco began as a small organization with only one company under it&rsquo;s roof. But now, Sitco has emerged as a Group with the beginning of this new decade i.e. 2010. Sitco has established it&rsquo;s presence in Kuwait market in various sectors and it&rsquo;s striving ahead to branch out into many more new business field. Sitco Group has a strong foundation. It has been nurtured and well taken care by the Owners &amp; Partners. It&rsquo;s dedicated employees have equally contributed their share of efforts in the growth of the group.<br />\r\nSitco Group never ceases the opportunity to grow. Sitco Group always welcomes new business concept and innovative. The Owners &amp; Partners with its team of experts study the pros &amp; cons of any new business concept before branching out into it. They study not only the profitability of the business but look 10 years ahead. The survival and long standing of the business.</p>\r\n\r\n<p>Currently SITCO Group operates in three different Business Sectors such as follows:<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Construction &amp; Project Services<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Real Estate<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Hospitality &amp; Leisure</p>\r\n\r\n<p>Furthermore, Sitco Group has followed a diversification policy, spreading its interests in upcoming and profitable business sectors by associating itself with international reputed brands. Sitco Group has moved from strength to strength i.e. from construction to real-estate management, hospitality &amp; leisure to technology and media to agencies Sitco Group has ventured into diverse businesses and courted success in all of them.</p>\r\n',0,'',0,'About SITCO Group',' ','<p>Sitco began as a small organization with only one company under it&rsquo;s roof. But now, Sitco has emerged as a Group with the beginning of this new decade i.e. 2010. Sitco has established it&rsquo;s presence in Kuwait market in various sectors and it&rsquo;s striving ahead to branch out into many more new business field. Sitco Group has a strong foundation. It has been nurtured and well taken care by the Owners &amp; Partners. It&rsquo;s dedicated employees have equally contributed their share of efforts in the growth of the group.<br />\r\nSitco Group never ceases the opportunity to grow. Sitco Group always welcomes new business concept and innovative. The Owners &amp; Partners with its team of experts study the pros &amp; cons of any new business concept before branching out into it. They study not only the profitability of the business but look 10 years ahead. The survival and long standing of the business.</p>\r\n\r\n<p>Currently SITCO Group operates in three different Business Sectors such as follows:<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Construction &amp; Project Services<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Real Estate<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Hospitality &amp; Leisure</p>\r\n\r\n<p>Furthermore, Sitco Group has followed a diversification policy, spreading its interests in upcoming and profitable business sectors by associating itself with international reputed brands. Sitco Group has moved from strength to strength i.e. from construction to real-estate management, hospitality &amp; leisure to technology and media to agencies Sitco Group has ventured into diverse businesses and courted success in all of them.</p>\r\n','<p>         .               1500s <img alt=\"IMG.  \" src=\"/media/uploads/2014/08/19/image71.jpg\" style=\"float:right; height:250px; margin-bottom:2px; margin-left:2px; margin-right:2px; margin-top:2px; width:300px\" />            .                .     1960s       Letraset         PageMaker        .</p>\r\n\r\n<p>         .               1500s             .                .     1960s       Letraset         PageMaker        .         1500s             .                .     1960s       Letraset         PageMaker        .</p>\r\n\r\n<p>         .              