s represent the company in good light and offer better services to the customers.</p>\r\n\r\n<p>&bull; <strong>Establishment of a Customer-centric mindset:</strong> Because only then would we be able to stay ahead in a highly competitive market. Customer Centricity at Sitco translates into understanding our customer&#39;s needs, meeting them and exceeding the expectations of our customers.</p>\r\n\r\n<p>&bull; <strong>Continuous improvement:</strong> Improvement and progress is our Group&#39;s lifeblood. Be it taking advantage of existing and emerging business opportunities or the adoption of highly advanced technologies, or fortifying our corporate culture by imbibing the best practices followed by leading organizations across the globe, we are on a constant path of self-improvement.</p>\r\n\r\n<p>This has helped us extend our horizons, expand our capabilities and explore new business opportunities. With your support and feedback, we believe we can scale greater heights in the years to come.</p>\r\n\r\n<p>Last but not the least, I appreciate your interest in Sitco and thank you for spending your valuable time with us. We look forward to seeing you here more often.</p>\r\n\r\n<p><strong>Ghassan AlSaleh</strong><br />\r\nPresident</p>\r\n',0,'',0,'Message From Board','   ','<p><img alt=\"Img. Message from Board\" src=\"/media/uploads/2014/08/18/board_message_img.jpg\" style=\"border-style:solid; border-width:2px; float:right; height:172px; margin:10px; width:304px\" />It is my pleasure to welcome you to our newly designed website and introduce you to the Sitco Group - a growing conglomerate that spans a diversified and innovative business portfolio.<br />\r\n&nbsp;<br />\r\nAs an organization, Sitco has transformed for the better auguring well for its clients, associates and the business as such. Some more changes that are expected to have a positive impact are on the anvil.</p>\r\n\r\n<p>As a transformed, diversified and growing business, we are focused on the follo