INSERT INTO `flatpages_flatpagepluginmodel` VALUES (136,'About Us','<p>KUD is a client focused project management company that specializes in providing practical solutions for managing all aspects of projects.</p>\r\n\r\n<p>Using our knowledge and expertise in design, construction and facility management, we understand our client needs and develop the best strategy to exceed their expectations in every way possible.</p>\r\n\r\n<p>KUD has been in existence within Kuwait since 2004 during which time it has maintained continuous and systematic growth providing project Management services over a wide scope.KUD is</p>\r\n\r\n<ul>\r\n	<li>Certified by Ministry of Planning as Project Management Consultant</li>\r\n	<li>An active member of Construction Management Association of America (CMAA)</li>\r\n	<li>Registered at Ministry of Commerce and Industry,Kuwait</li>\r\n	<li>Prequalified with Ahli United Bank and Kuwait International Bank as Project Management Consultant.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>KUD team includes qualified architects, engineers of various disciplines, quantity surveyors, value engineers, contract administrators, planning and cost engineers.Our staffs are extremely familiar and competent in the various contracts formats and standard permitting a wide range of contractual arrangements and relationships.</p>\r\n\r\n<p>As an ISO certified company, KUD is committed to consistently provide high quality services for our clients through adherence to our Quality management system that is developed based on BSEN ISO9001:2008</p>\r\n'),(138,' ','<p>Kuwait United Development is an accomplishment of a great team of professonals with diversified and international expertise that provide full range of management services and solutions.</p>\r\n            <p>Since establishment in 2004, KUC is serving the public and private sector clients in Kuwait, GCC and World wide and are proud that 80% of our business is with repeated clients, this is a result of the quality, fliexibility and creativity of services that is provided. Long term client relationship is the main focus at KUD.</p>\r\n            <h5>The Scope of Services under Total Project Management include:</h5>\r\n            <ul>\r\n            	<li>Design Management</li>\r\n                <li>Design Management</li>\r\n                <li>Design Management</li>\r\n                <li>Design Management</li>\r\n            </ul>'),(185,' ','<p>Kuwait United Development is an accomplishment of a great team of professonals with diversified and international expertise that provide full range of management services and solutions.</p>\r\n            <p>Since establishment in 2004, KUC is serving the public and private sector clients in Kuwait, GCC and World wide and are proud that 80% of our business is with repeated clients, this is a result of the quality, fliexibility and creativity of services that is provided. Long term client relationship is the main focus at KUD.</p>\r\n            <h5>The Scope of Services under Total Project Management include:</h5>\r\n            <ul>\r\n            	<li>Design Management</li>\r\n                <li>Design Management</li>\r\n                <li>Design Management</li>\r\n                <li>Design Management</li>\r\n            </ul>'),(140,'About Us','<p>KUD is a client focused project management company that specializes in providing practical solutions for managing all aspects of projects.</p>\r\n\r\n<p>Using our knowledge and expertise in design, construction and facility management, we understand our client needs and develop the best strategy to exceed their expectations in every way possible.</p>\r\n\r\n<p>KUD has been in existence within Kuwait since 2004 during which time it has maintained continuous and systematic growth providing project Management services over a wide scope.KUD is</p>\r\n\r\n<ul>\r\n	<li>Certified by Ministry of Planning as Project Management Consultant</li>\r\n	<li>An active member of Construction Ma