INSERT INTO `home_homecontents` VALUES (1,'SITCO Group','Sitco Group - A growing conglomerate that spans a diversified and innovative business portfolio',1,'Message From Board','<p>It is my pleasure to welcome you to our newly designed website and introduce you to the Sitco Group - a growing conglomerate that spans a diversified and innovative business portfolio.<br />\r\n&nbsp;<br />\r\nAs an organization, Sitco has transformed for the better auguring well for its clients, associates and the business as such. Some more changes that are expected to have a positive impact are on the anvil. This has helped us extend our horizons, expand our capabilities and explore new business opportunities. With your support and feedback, we believe we can scale greater heights in the years to come.</p>\r\n\r\n<p>Last but not the least, I appreciate your interest in Sitco and thank you for spending your valuable time with us. We look forward to seeing you here more often.</p>\r\n\r\n<p><strong>Ghassan AlSaleh</strong><br />\r\nPresident</p>\r\n','SITCO Group',' ','Sitco Group - A growing conglomerate that spans a diversified and innovative business portfolio','       ','Message From Board','  ','<p>It is my pleasure to welcome you to our newly designed website and introduce you to the Sitco Group - a growing conglomerate that spans a diversified and innovative business portfolio.<br />\r\n&nbsp;<br />\r\nAs an organization, Sitco has transformed for the better auguring well for its clients, associates and the business as such. Some more changes that are expected to have a positive impact are on the anvil. This has helped us extend our horizons, expand our capabilities and explore new business opportunities. With your support and feedback, we believe we can scale greater heights in the years to come.</p>\r\n\r\n<p>Last but not the least, I appreciate your interest in Sitco and thank you for spending your valuable time with us. We look forward to seeing you here more often.</p>\r\n\r\n<p><strong>Ghassan AlSaleh</strong><br />\r\nPresident</p>\r\n','<p>    AMET consectetur adipiscing . Aliquam  rutrum   consequat augue  commodo . CRAS  blandit    .  suscipit   egestas congue.   quam   laoreet aliquam. Donec      eleifend cursus.  venenatis  ENIM   .    AMET consectetur adipiscing . Aliquam  rutrum   consequat augue  commodo . CRAS  blandit    .  suscipit   egestas congue.   quam   laoreet aliquam. Donec      eleifend cursus.  venenatis  ENIM   .CRAS  blandit    .  suscipit   egestas congue.   quam   laoreet aliquam. Donec      eleifend cursus.  venenatis  ENIM   .</p>\r\n');
